import React from "react";
import { useNavigate } from "react-router-dom";
import Home from '../pages/Home'
import News from '../pages/News'

const HomePage = () => {
  const navigate = useNavigate();
  return (
    <div>
      <Home/>
    </div>
  );
};

const NewsPage = () => {
  const navigate = useNavigate();
  return (
    <div>
      <News/>
    </div>
  );
};

export default function Route() {
  return (
    <>
      <HomePage path="/" />
      <NewsPage path="/news" />
    </>
  );
}
